import React,{Component} from "react";

class Home extends Component{
  render(){
    return (
      <div id="home">
        <h1 style={{ color: this.props.color }}>
          {this.props.username} is a Web Developer from {this.props.city}
        </h1>
        <ul>
          {this?.props?.repos.map((e,index) => {
            return <li>{e.name}</li>
          })}
        </ul>
      </div>
    );
  }
}
export default Home;
